import React from 'react'
import {Link} from 'react-router-dom'

export const RateList = ({ users }) => {
  if (!users.length) {
    return <p className="center">Звданий пока нет</p>
  }
  return (
    <table>
    <thead>
    <tr>
      <th>№</th>
      <th>Название</th>
      <th>Рейтинг</th>
      <th>Ссылка</th>
    </tr>
    </thead>

    <tbody>
    {users.map((user, index) => {
      return (
        <tr>
          <td>{index + 1}</td>
          <td>{user.email}</td>
         <td>{user.rate}</td>
          <td>
            Открыть
          </td>
        </tr>
      )
    }) }
    </tbody>
  </table>
  )
}
